import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
    OwpDateTimePicker,
} from 'owp/wrapper';
import Icon from '@material-ui/core/Icon';
import * as TGEvent from 'owp/TGEvent';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    content={
                        <React.Fragment>
                            <div>
                                <div className="col-lg-12 pd0">
                                    <div className="portlet light mgb0">
                                        <div className="portlet-title">
                                            <div className="caption">
                                                <Icon className="ico_m01 c04">insert_chart</Icon>
                                                <span className="font-dark bold uppercase"> 알람 메시지 설정 관리 </span>
                                                <span className="caption-helper"> </span>
                                            </div>
                                            <div className="flex justify-end">
                                                <OwpButton color="secondary" variant="contained">등록</OwpButton>
                                                <OwpButton color="secondary" variant="contained">수정</OwpButton>
                                                <OwpButton color="secondary" variant="contained">삭제</OwpButton>
                                            </div>
                                        </div>
                                        <OwpTreeGrid
                                            id="C0804001"
                                            LayoutUrl={'/assets/data/C0804001Def.xml'}
                                            DataUrl={'/assets/data/C0202000Data.xml'}
                                            height="35vh"
                                        />
                                    </div>
                                </div>

                                <div className="col-lg-12 pd0">
                                    <div className="portlet light mg0">
                                        <div className="portlet-title">
                                            <div className="caption">
                                                <Icon className="ico_m01 c04">insert_chart</Icon>
                                                <span className="font-dark bold uppercase">알람 메시지 발송/해제 관리</span>
                                                <span className="caption-helper"> </span>
                                            </div>
                                            <div className="flex justify-end">
                                                <OwpButton color="secondary" variant="contained">재발신</OwpButton>
                                                <OwpButton color="secondary" variant="contained">강제 중단</OwpButton>
                                                
                                            </div>
                                        </div>
                                        <OwpTreeGrid
                                            id="C0804002"
                                            LayoutUrl={'/assets/data/C0804002Def.xml'}
                                            DataUrl={'/assets/data/C0202000Data.xml'}
                                            height="33vh"
                                        />
                                    </div>
                                </div>
                            </div>
                        </React.Fragment>
                    }
                    innerScroll
                    
                />

            </React.Fragment>
        );
    }
}

export default Page;
